        `},{question:"\u041A\u0430\u043A\u043E\u0435 \u0444\u043E\u0442\u043E \u0434\u043E\u0431\u0430\u0432\u0438\u0442\u044C \u0432 \u043F\u0440\u043E\u0444\u0438\u043B\u044C?",answer:`
